12	IGNITION	NIT Raipur	2019-08-31	TBD	Every human mind blossoms with numerous ideas. But what really matters is its\r\nimplementation.\r\nAre you someone who has a knack of analyzing strategic advantages and pitfalls\r\ncompanies face? Then, Ignition- the B-Model competition is the perfect room to\r\ndevelop your own B-Model. Also, get a chance to be funded. So, aspirants get ready to\r\nput your thinking caps on as you'll be grilled with a barrage of questions regarding your\r\nprototype. The only thing which matters here is how well you can formulate your idea.\r\nEverything else is inconsequential here. We are anticipating for the ‘next big thing’. Are\r\nyou ready?	static/uploads/events/cover/ig111.png	static/uploads/events/icon/ig111.png	bmodel.ecellnitrr@gmail.com	1	2019	2019-07-26 13:38:06	2019-08-30 07:28:55		<div>Every human mind blossoms with numerous ideas. But what really matters is its implementation. Are you someone who has a knack of analyzing strategic advantages and pitfalls companies face? Then, Ignition- the B-Model competition is the perfect room to develop your own B-Model. Also, get a chance to be funded. So, aspirants get ready to put your thinking caps on as you'll be grilled with a barrage of questions regarding your prototype. The only thing which matters here is how well you can formulate your idea. Everything else is inconsequential here. We are anticipating for the ‘next big thing’. Are you ready?</div>
