22	INNOVATION MANTHAN	DDU Auditorium	2019-09-01	TBD	A stepping stone for your future startup ideas.	static/uploads/events/cover/Event_Logos-20.png	static/uploads/events/icon/Event_Logos-20.png	precellnitrr@gmail.com	1	2019	2019-07-26 13:39:19	2019-08-28 11:07:13		<h1 class="western"><div><b style="font-size: 20pt; color: rgb(206, 222, 231);">Theme</b><br></div></h1>\r\n<p style="margin-bottom: 0in">We aim to support UNICEF and the SDGs\r\ngoals with your brilliant(pragmatic) project idea. Please do mark\r\nbelow points fulfilled by your project in the form.</p>\r\n<p style="margin-bottom: 0in"><br>\r\n\r\n</p>\r\n<p style="margin-bottom: 0in"><i>SUSTAINABLE DEVELOPMENT</i></p>\r\n<ol>\r\n\t<li>\r\n<p style="margin-bottom: 0in">No poverty</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Zero Hunger</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Good Health and well being</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Quality Education</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Gender Equality</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Clean Water and sanitization</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Affordable and clean energy</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Decent work and economic growth \r\n\t</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Industry, innovation and\r\n\tinfrastructure</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Reduced inequalities</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Sustainable cities and\r\n\tcommunities</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Responsible consumption and\r\n\tproduction</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Climate action</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Life below water</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Life on land</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Peace, justice and strong\r\n\tinstitutions</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Partnership for the goals</p>\r\n</li></ol><h1 class="western"><b style="color: rgb(214, 239, 214);">Prize</b></h1><ul>\r\n\t<li>\r\n<p style="margin-bottom: 0in">Selected teams will be given a\r\n\tseed grant of Rs. 25000 and access to Makerspace and Mentorship\r\n\t(alumni network) and Patenting.</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Top team from each domain will\r\n\tbe given Goodies worth (according to spons) and free entry to our 5\r\n\tday workshop (approximately during October).</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">All selected teams will be\r\n\teligible for attending the <b>Design thinking workshop</b>.</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">All the finalists will be given\r\n\ta time period to develop their prototypes after which they will be\r\n\tgiven Rs. 50,000 as acceleration grant (if eligible).</p>\r\n</li></ul><h1 class="western"><b style="color: rgb(206, 222, 231);">Perks</b></h1><ul>\r\n\t<li>\r\n<p style="margin-bottom: 0in">Certificate of participation.</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Publicity of all teams through\r\n\tsocial media platforms.</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Food and refreshments all teams.</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">ID cards for all participants.</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Set up of booth.</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Proper electricity supply during\r\n\tprototype presentation.</p>\r\n</li></ul><h1 class="western"><span style="color: rgb(206, 222, 231);"><a name="_de2czhbpdal0"></a><b style="">Judges</b></span></h1><p style="margin-bottom: 0in">Senior Faculties, 36Inc…</p><p style="margin-bottom: 0in">Chief guest - distribution of prizes</p><h1 class="western"><span style="color: rgb(206, 222, 231);"><a name="_x6gprwqg3a08"></a><b style="">Rules\r\nand Regulation</b></span></h1><p style="margin-bottom: 0in"><i>REGISTRATION:</i></p><ul>\r\n\t<li>\r\n<p style="margin-bottom: 0in">Teams can register through\r\n\tgoogle form. Details like name, college, team name, team leader name\r\n\t+ contact(WhatsApp + call), Project name, and abstract in pdf/docx\r\n\tformat must be submitted. (links to videos/ photos to for working\r\n\tprototypes (optional))</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">40 Selected teams will be\r\n\tinformed to the team leader through email and SMS on the basis of\r\n\tabstracts and originality of the ideas.</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Teams will be given details\r\n\tabout the Lean canvas that they must prepare which will cover points\r\n\tlike Problem statement, Solution, Value proposition, (Revenue Model)\r\n\tetc. This Lean canvas should be printed by teams in A3 sheets.</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in"><i>Selected teams are\r\n\tcompulsorily required to maintain softcopy as well as hard copy of\r\n\tlean canvas before final day.</i></p>\r\n</li></ul><ul>\r\n\t<li>\r\n<p style="margin-bottom: 0in">Students must have a lean canvas\r\n\tready during the final presentation day which should be of specific\r\n\tformat as described in (). Also maintain an online copy of the same.</p>\r\n\t</li><li>\r\n<p style="margin-bottom: 0in">Per team the presentation time\r\n\tlimit in front of judges will be restricted to 5 mins.</p>\r\n</li></ul><p style="margin-left: 0.75in; margin-bottom: 0in">Booths will be set\r\nup by 9 am and can be visited till 12 pm. It is mandatory that at\r\nleast 1 person should be present near the booth.</p><p style="margin-left: 0.75in; margin-bottom: 0in"><br></p><ul>\r\n\t<li>\r\n<p style="margin-bottom: 0in"><i>Maximum no. Of participants\r\n\tin a team is 4 and minimum 1.</i> (all team members must be from the\r\n\tsame college). <i>College</i> should be within <i>Chhattisgarh</i>\r\n\tregion.</p>\r\n</li></ul><p>\r\n\t\r\n\t\r\n\t<style type="text/css">\r\n\t\t@page { margin: 0.79in }\r\n\t\th1 { margin-top: 0.28in; margin-bottom: 0.08in; page-break-inside: avoid }\r\n\t\th1.western { font-family: "Arial", serif; font-size: 20pt; font-weight: normal }\r\n\t\th1.cjk { font-size: 20pt; font-weight: normal }\r\n\t\th1.ctl { font-size: 20pt; font-weight: normal }\r\n\t\tp { margin-bottom: 0.1in; direction: ltr; line-height: 115%; text-align: left; orphans: 0; widows: 0 }\r\n\t</style>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><ul>\r\n\t<li>\r\n<p style="margin-bottom: 0in">All the required documents must\r\n\tbe submitted before the final round.</p><p style="margin-bottom: 0in"><br></p><p style="margin-bottom: 0in"><span style="font-size: 24px; color: rgb(206, 222, 231);"><b><u>Terms And Conditions</u></b></span></p><p style="margin-bottom: 0in"><span style="font-size: 24px; color: rgb(206, 222, 231);"><b><u><br></u></b></span><font style="font-size: 12pt;"><span lang="en-US">1. Among the participating teams, 3 teams would be ranked 1</span></font><sup style="font-size: 10.5px;"><font style="font-size: 12pt;"><span lang="en-US">st</span></font></sup><font style="font-size: 12pt;"><span lang="en-US">, 2</span></font><sup style="font-size: 10.5px;"><font style="font-size: 12pt;"><span lang="en-US">nd</span></font></sup><font style="font-size: 12pt;"><span lang="en-US">, 3</span></font><sup style="font-size: 10.5px;"><font style="font-size: 12pt;"><span lang="en-US">rd</span></font></sup><font style="font-size: 12pt;"><span lang="en-US">&nbsp;in order of performance.</span></font></p><p style="margin-bottom: 0in"><font style="font-size: 12pt;"><span lang="en-US"><br></span></font><span style="font-size: 12pt;">2. The top performing team(s) would be given a chance to be incubated under NIT Raipur.</span></p><p style="margin-bottom: 0in"><span style="font-size: 12pt;"><br></span><span style="font-size: 12pt;">3. Incubation includes the following provisions</span></p><p style="margin-bottom: 0in"><span style="font-size: 12pt;"><br></span><span style="font-size: 12pt;">&nbsp; &nbsp; a. Seed Grant of Rs. 25000 would be provided for prototype (applicable for NIT Students).</span></p><p style="margin-bottom: 0in"><span style="font-size: 12pt;"><br></span><span style="font-size: 12pt;">&nbsp; &nbsp; b. Acceleration Grant of Rs. 50000 would be provided (applicable for NIT and non-NIT students).</span></p><p style="margin-bottom: 0in"><span style="font-size: 12pt;"><br></span><span style="font-size: 12pt;">&nbsp; &nbsp; c.Access to Makerspace and Mentorship would be provided (applicable for NIT and non-NIT students)</span></p><p style="margin-bottom: 0in"><span style="font-size: 12pt;"><br></span><span style="font-size: 12pt;">4. If the teams do not submit the required documents in the given time, they would not be eligible for the above provisions.&nbsp;&nbsp;</span></p>\r\n</li></ul><style type="text/css">\r\n\t\t@page { margin: 0.79in }\r\n\t\th1 { margin-top: 0.28in; margin-bottom: 0.08in; page-break-inside: avoid }\r\n\t\th1.western { font-family: "Arial", serif; font-size: 20pt; font-weight: normal }\r\n\t\th1.cjk { font-size: 20pt; font-weight: normal }\r\n\t\th1.ctl { font-size: 20pt; font-weight: normal }\r\n\t\tp { margin-bottom: 0.1in; direction: ltr; line-height: 115%; text-align: left; orphans: 0; widows: 0 }\r\n\t</style><style type="text/css">\r\n\t\t@page { margin: 0.79in }\r\n\t\th1 { margin-top: 0.28in; margin-bottom: 0.08in; page-break-inside: avoid }\r\n\t\th1.western { font-family: "Arial", serif; font-size: 20pt; font-weight: normal }\r\n\t\th1.cjk { font-size: 20pt; font-weight: normal }\r\n\t\th1.ctl { font-size: 20pt; font-weight: normal }\r\n\t\tp { margin-bottom: 0.1in; direction: ltr; line-height: 115%; text-align: left; orphans: 0; widows: 0 }\r\n\t</style><style type="text/css">\r\n\t\t@page { margin: 0.79in }\r\n\t\th1 { margin-top: 0.28in; margin-bottom: 0.08in; page-break-inside: avoid }\r\n\t\th1.western { font-family: "Arial", serif; font-size: 20pt; font-weight: normal }\r\n\t\th1.cjk { font-size: 20pt; font-weight: normal }\r\n\t\t