duals with diverse passions and backgrounds. You’ll be working directly with the Founders of the startup. If you’re down to join the Kite Crew, hit us up!</span></p>\n<p></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">In your position at Kite, you will:</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">- Help manage the full sales-cycle, including contract generation and other deliverables for closing.</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">- Proactively call new users to help them sign up, onboard, and run their first transaction with Kite</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">- Visit potential clients at offices and distribute marketing materials / explain the value proposition</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">- Present Kite’s value proposition and solutions using appropriate value-based sales approaches and techniques, including team and/or consultative presentations and efforts.</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">- Assist with the technical onboarding of the customers’ Kite account</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">- Drive a high volume of sales by managing the complete sales process</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">- Hit Monthly / Quarterly Sales Goals</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">- Interface with all levels of the target clients, including Finance, HR/Recruiting, Legal</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">- Collaborate and lead successful execution of sales activities with internal cross-functional teams, with senior management, through contract negotiation and signed contracts</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">- Manage all sales activity and monthly forecasting of revenue in the CRM</span></p>\n<p></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">It’s essential that you:</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">- Are hands-on and execute quickly</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">- Want to work in a growth-stage startup</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">- Have strong communication skills and can speak English &amp; Hindi</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">- Are available for a period of at least 3 months</span></p>\n<p></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">Other specifics:</span></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">Location: Delhi-NCR</span></p>\n<p></p>\n<p></p>\n<p><span style="color: rgb(22,32,64);background-color: rgb(255,255,255);font-size: 14px;font-family: helvetica neue", arial, helvetica, freesans, "liberation sans", "numbus sans l", sans-serif;">If interested, please apply at https://angel.co/kiteforbusiness/jobs or email people@kite.work. Please look over https://kite.work to review our products.</span></p>	Fintech	249/A, 2nd Flr,	Okhla Phase 3	New Delhi	Delhi	India	1	2019-08-28 09:56:54	2019-08-30 09:24:29	1020
